import "./topbar.css"

function Topbar() {
    return (
      <div className="topbarContainer">
        <div className="topbarLeft">
            <span className="logo">Lamasocial</span>
        </div>
        <div className="topbarCenter">
            .search
        </div>
        <div className="topbarRight"></div>
      </div>
    );
}

export default Topbar
